import React, { Component } from "react";
import Seccion from "./Seccion";

export default class Tablero extends Component {
  render() {
    return (
      <div style={{ "background-color": "#d1d1d1", display: "flex" }}>
        <div style={{ "margin-right": "20px" }}>
          <Seccion />
        </div>
        <Seccion />
        <Seccion />
      </div>
    );
  }
}
